import React from 'react';

//components
import QuestionPost from './QuestionPost';

// data entry
import dummyData from '../questionPosts_db';

const MainFeed = () => {
    console.log(dummyData);

    return (
        <div className="main-feed" >
            <div className="question-input">
                <div className="user-photo">
                    <img src="https://randomuser.me/api/portraits/women/32.jpg" alt="User's profile picture" />
                </div>
                <div className="content">

                    <div className="title">
                        Ask a question ...adfadsfadfasdfasdfasdfasdfasdfasdfadsfasdfasdfasdfasdfasdfasdf
                    </div>
                </div>
            </div>
            {
                dummyData.map((questionDetails, id) => (
                    <QuestionPost key={id} questionDetails={questionDetails} />
                ))
            }

        </div>
    )


}

export default MainFeed;
